export const initialItems = (res) => ({
  type: "INITIAL_ITEMS",
  items: res
})



export const subscribeChat = (socket, id, item) =>{
  return (dispatch) => {
    let postData ={
      id: id+1,
      item: item,
      completed: false
    }
    socket.emit('addItem', postData)
  }
}
